INSERT INTO `t_documentos` (`id`, `date_time`, `descripcion`, `tipo`, `programa`) VALUES
	(5, '2014-05-13 10:33:57', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 1),
	(6, '2014-05-13 10:34:22', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 1),
	(7, '2014-05-13 10:33:57', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 2),
	(8, '2014-05-13 10:34:22', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 2),
	(9, '2014-05-13 10:36:46', 'Memoria o proyecto de tesis', '2', 2),
	(10, '2014-05-13 10:36:46', 'Carta de aceptación', '2', 2),
	(11, '2014-05-13 10:33:57', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 3),
	(12, '2014-05-13 10:52:27', 'Propuesta de proyecto:\r\n-Título del proyecto de tesis.\r\n-Línea de investigación a la que se adscribe el doctorando.\r\n-Breve descripción del proyecto (máx. 500 palabras).\r\n-Valoración y aval del director y/o tutor que se propone sobre el proyecto.\r\n-Carta de presentación del estudiante por científicos acreditados (puede servir el aval del Director o Tutor o la carta de cualquier otro investigador que haya tenido relación profesional con el solicitante)', '2', 3),
	(13, '2014-05-13 10:53:41', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato, estancias, idiomas, etc.', '2', 4),
	(14, '2014-05-13 10:53:58', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 4),
	(15, '2014-05-13 10:54:23', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 6),
	(16, '2014-05-13 10:54:23', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 6),
	(17, '2014-05-13 10:55:05', 'Plan de trabajo que incluya: Introducción, Objetivos, Metodología, Cronograma y Bibliografía. La extensión máxima del Plan de trabajo será de 20 páginas y deberá estar avalado por un tutor miembro del programa con plena capacidad para dirigir tesis doctorales', '2', 6),
	(18, '2014-05-13 10:53:41', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.', '2', 7),
	(19, '2014-05-13 10:57:20', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 7),
	(20, '2014-05-13 10:58:10', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.', '2', 9),
	(21, '2014-05-13 10:58:31', 'Carta de solicitud, con mención expresa de la motivación de la misma. En la misma se deberá indicar la línea de investigación del Doctorado en Comunicación por la cual el solicitante opta', '2', 9),
	(22, '2014-05-13 10:58:31', 'Proyecto preliminar de tesis doctoral (4 folios) que contendrá los siguientes apartados: Título,objetivos, fundamentos teóricos y metodológicos, bibliografía', '2', 9),
	(23, '2014-05-13 10:59:52', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato y organizado teniendo en cuenta los Criterios de Admisión', '2', 8),
	(24, '2014-05-13 10:59:52', 'Certificaciones de estudios complementarios (idiomas, etc.) y de le experiencia profesional previa, si los hubiera', '2', 8),
	(25, '2014-05-13 11:00:47', 'Carta de un profesor del Programa de Doctorado manifestando su interés en tutelar y/o dirigir la investigación del solicitante. Esta carta no es obligatoria, pero en su ausencia, no se otorgarán los puntos correspondientes en la evaluación de los Criterios de Admisión', '2', 8),
	(26, '2014-05-13 10:59:52', 'Los alumnos que soliciten la realización de los estudios de doctorado a tiempo parcial, deberán aportar una Memoria justificativa que soporte tal solicitud.', '2', 8),
	(27, '2014-05-13 11:01:37', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 5),
	(28, '2014-05-13 11:03:13', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito.', '2', 5),
	(29, '2014-05-13 11:03:13', 'Escrito explicativo que contenga:\r\n- Título del proyecto de tesis y línea de investigación en la que se integra.\r\n- Breve descripción del proyecto a desarrollar.\r\n- Aceptación por parte del director propuesto, que informará y avalará el proyecto presentado.\r\n- Propuesta de tutor, en su caso, con el visto bueno del mismo y del director.', '2', 5),
	(30, '2014-05-13 11:04:16', 'Currículum vitae indicando experiencia profesional e investigadora, publicaciones, formación impartida y recibida.', '2', 10),
	(31, '2014-05-13 11:04:16', 'Carta de motivación, indicando el ámbito de interés para realizar la tesis doctoral, la experiencia previa en dicho ámbito y una propuesta de proyecto de tesis y programa de trabajo (incluyendo posibles contactos previos con un posible tutor/director y posibilidades de financiación).', '2', 10),
	(32, '2014-05-13 11:05:44', 'Documento acreditativo de un nivel B1 de conocimiento de lengua inglesa que le permita el seguimiento de seminarios, conferencia y discusiones científicas y dominio de la expresión escrita', '2', 10),
	(33, '2014-05-13 11:20:16', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 12),
	(34, '2014-05-13 11:20:16', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 12),
	(183, '2015-09-09 09:05:04', 'Acreditación nivel B1 de Inglés.', '2', 11),
	(181, '2015-09-09 07:53:24', '<a href="http://institucional.us.es/educacion/sites/default/files/Carta_aval_tutor.pdf" target=\'_blank\'>Carta aval firmada por el tutor del doctorando</a>, caso de que el director sea un profesor que no pertenezca al programa de doctorado.', '2', 11),
	(37, '2014-05-13 11:21:38', 'Curriculum vitae indicando datos personales y profesionales', '2', 11),
	(180, '2015-09-09 07:53:24', '<a href="http://institucional.us.es/educacion/sites/default/files/Carta_aval_director.pdf" target=\'_blank\'>Carta aval firmada por el director de la tesis doctoral.</a>', '2', 11),
	(38, '2014-05-13 11:21:38', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 13),
	(39, '2014-05-13 11:22:20', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito', '2', 13),
	(40, '2014-05-13 11:22:20', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 14),
	(41, '2014-05-13 11:23:10', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito. En la carta el candidato debe exponer sus preferencias por las líneas de investigación del programa y por los equipos que lo integran', '2', 14),
	(42, '2014-05-13 11:23:10', 'Documentos que acrediten los méritos específicamente valorados en el acceso (conocimiento de idiomas y beca o contrato de investigación ligado a un profesor del programa)', '2', 14),
	(43, '2014-05-13 11:23:42', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato.', '2', 15),
	(44, '2014-05-13 11:23:42', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito.', '2', 15),
	(45, '2014-05-13 11:24:18', 'Breve proyecto de trabajo avalado por el visto bueno de un profesor del programa, que actuará como su tutor', '2', 15),
	(46, '2014-05-13 11:24:18', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato', '2', 17),
	(47, '2014-05-13 11:25:05', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en el ámbito de la gestión de empresas y de los negocios internacionales', '2', 17),
	(48, '2014-05-13 11:25:05', 'Datos personales completos. Entre ellos, si fuera necesario, se informará de las necesidades especiales derivadas de la discapacidad del candidato.', '2', 17),
	(49, '2014-05-13 11:25:25', 'Currículum Vitae completo y actualizado, detallando la experiencia profesional e investigadora del candidato, con la siguiente estructura de contenidos:\r\n1. Datos Generales (Nombre, DNI, fecha de nacimiento, dirección, teléfono, e-mail\r\n2. Experiencia investigadora\r\n2.1. Publicación de artículos en revistas científicas de prestigio reconocido (JCR del Science Citation Index)\r\n2.2. Publicación de libros o capítulos de libros\r\n2.3. Participación en proyectos de investigación obtenidos en convocatorias públicas y competitivas, en especial los financiados mediante programas nacionales, europeos u otros de ámbito internacional y/o contratos de investigación con empresas o con la administración pública.\r\n2.4. Contribuciones presentadas en Congresos, conferencias, seminarios u otros tipos de reuniones de relevancia científica.\r\n2.5. Otros méritos de investigación no contemplados en los apartados anteriores.\r\n3. Formación académica, experiencia docente y profesional.\r\n3.1. Formación académica\r\n3.2. Estancias de carácter investigador y/o formativo en centros de investigación.\r\n3.3. Experiencia docente\r\n3.4. Experiencia profesional\r\n3.5. Otros méritos', '2', 16),
	(50, '2014-05-13 11:25:25', 'Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito (esta carta servirá de presentación del candidato a doctorando ante la Comisión Académica del Programa de Doctorado). En ella se puede indicar los motivos que mueven al alumno a cursar este Programa, la afinidad de su trayectoria formativa y/o profesional con la temática a investigar, o las expectativas laborales y personales que este Programa le suscita', '2', 16),
