	(2080, 11, '2016-10-08 19:03:00', '0000-00-00 00:00:00', '2016-10-09 00:46:00', '0000-00-00 00:00:00', '2016-10-31 23:36:49', 5, 2470, 'S02470C05U05533P02', 'marescenografia@hotmail.com', '1', 'OLEGARIO MARTÍN SÁNCHEZ ', 'parcial', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 15, 2, '', 9.00, 'Entre la DOCUMENTACIÓN GENERAL, faltan los siguientes documentos:\r\n–Certificado de notas correspondientes a la licenciatura en Bellas Artes.\r\n–Impreso A07, y justificación documental, para ser admitida en la modalidad de matrícula a tiempo parcial.\r\nEntre la DOCUMENTACIÓN ESPECÍFICA faltan:\r\n–Memoria/proyecto de tesis.\r\n–Carta de aceptación.\r\n\r\nAsimismo, debe modificar la propuesta de Tutor y Director de tesis:\r\n–Para ambas funciones propone al profesor D. Olegario Martín Sánchez, que no puede desempeñar ninguna de ellas por no tener experiencia investigadora acreditada según lo previsto el el RD 1086/1989.\r\nEste profesor puede ser 2º director de tesis (codirector).', 0, 390, '1'),
	(2081, 11, '2016-10-08 19:24:00', '0000-00-00 00:00:00', '2016-10-09 00:47:00', '2016-10-21 09:55:00', '2016-11-01 00:03:12', 5, 1608, 'S01608C05U04483P02', 'antonioasensiorocha@gmail.com', '3', 'Dr. Luis F. Martínez Montiel', 'completo', '', 14, 2, '', 48.46, 'FALTA TODA LA DOCUMENTACIÓN GENERAL.', 1, 390, '1'),
	(2082, 11, '2016-10-08 19:41:00', '0000-00-00 00:00:00', '2016-10-09 00:48:00', '2016-10-17 14:13:00', '2016-11-01 00:07:33', 5, 2264, 'S02264C05U04560P02', 'fjcarrascomurillo@gmail.com', '3', 'Francisco Javier Cornejo Vega', 'completo', '', 16, 2, '', 42.74, '1. Propone como Directora de tesis a la profeora Dª María Arjonilla Álvarez, que no puede serlo por carecer de experiencia investigadora acreditada según lo previsto en el Real Decreto 1086/1989.\r\nEsta profesora puede ser Directora 2ª de tesis (codirectora). Debe proponer un Director 1º de tesis.\r\n\r\n2. Falta la Carta de aceptación del Tutor que propone.', 1, 390, '1'),
	(2083, 11, '2016-10-08 19:55:00', '0000-00-00 00:00:00', '2016-10-09 00:48:00', '0000-00-00 00:00:00', '2016-10-31 23:39:29', 5, 1682, 'S01682C05U04573P02', 'eugcirmon@alum.us.es', '1', '', 'parcial', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 6.16, '–No ha entregado Memoria/Proyecto de tesis.\r\n–No ha entregado el impreso A07, necesario para la modalidad de matrícula a tiempo parcial que solicita.', 0, 390, '1'),
	(2084, 11, '2016-10-08 20:10:00', '0000-00-00 00:00:00', '2016-10-09 00:49:00', '2016-10-10 18:42:00', '2016-11-01 00:11:18', 5, 1937, 'S01937C05U05014P02', 'ocolas@us.es', '3', 'María del Mar Bernal Pérez', 'completo', '', 14, 2, '', 59.62, '–Falta CERTIFICADO DE NOTAS DE LA LICENCIATURA..\r\n–Falta CARTA DE ACEPTACIÓN de la tutora y directora de tsis que propone, cumplimentado en el impreso DE04 que está en la web del programa (ha entregado el impreso correspondiente a los informes que tutor y director deben emitir para la evaluación anual del Plan de Investigación y del Documento de Actividades del Doctorando de los estudiantes matriculados en el programa de doctorado).', 1, 390, '1'),
	(2085, 11, '2016-10-08 20:38:00', '0000-00-00 00:00:00', '2016-10-09 00:49:00', '2016-10-10 11:43:00', '2016-10-31 23:42:21', 5, 1871, 'S01871C05U04932P02', 'mjdelosreyesmanzano@gmail.com', '1', 'María Pilar García Fernández', 'completo', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 15, 2, '', 21.34, 'Entre la Documentación General que los solicitantes de admisión deben entregar, se encuentra "Acreditación de Estudios Universitarios oficiales previos (Grado, Licenciatura, Diplomatura, etc.). Se requerirá el titulo de los estudios previos (o resguardo de abono de derechos de expedición) y certificado de notas", documentos que no ha entregado.', 1, 390, '1'),
	(2086, 11, '2016-10-08 20:54:00', '0000-00-00 00:00:00', '2016-10-09 00:50:00', '0000-00-00 00:00:00', '2016-10-31 23:44:45', 5, 1643, 'S01643C05U04545P02', 'migdiacar2@alum.us.es', '1', '', 'completo', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 10.28, 'No ha entregado Memoria/Proyecto de tesis.', 0, 390, '1'),
	(2087, 11, '2016-10-08 21:09:00', '0000-00-00 00:00:00', '2016-10-09 00:51:00', '0000-00-00 00:00:00', '2016-10-31 23:46:33', 5, 2542, 'S02542C05U05204P02', 'auxiliadora_gil@telefonica.net', '1', 'Luis F. Martínez Montiel', 'parcial', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 6.68, 'Entre los DOCUMENTOS ESPECÍFICOS que los solicitantes de admisión deben entregar con su solicitud, no ha entregado los siguientes:\r\n–Memoria/Proyecto de tesis.\r\n–Cartas de aceptación del Tutor y  dos Codirectores de tesis propuestos.\r\n–CV de los dos profesores externos al programa de doctorado Arte y Patrimonio, que propone como Codirctores de tesis.\r\n–Acreditación de que el profesor que propone como Diretor 1º de tesis posee experiencia investigadora acreditada en los términos que establece el Real Decreto 1086/1989.\r\n\r\n2. Entre la DOCUMENTACIÓN GENERAL que hay que entregar, y no ha entregado, se encuentran el impreso A07 y documento que justifique su solicitud de ser admitida en la modalidad de matrícula a tiempo parcial.', 0, 390, '1'),
	(2088, 11, '2016-10-08 21:36:00', '0000-00-00 00:00:00', '2016-10-09 00:52:00', '2016-10-21 22:47:00', '2016-10-31 23:48:00', 5, 2299, 'S02299C05U05398P02', 'ficoman@gmail.com', '1', 'Santiago Navarro - US', 'completo', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 15, 2, '', 20.00, 'Debe completar la documentación requerida, entregando los siguientes documentos:\r\n\r\n–CV académico e investigador del solicitante, cumplimentado en el impreso DE01 (está en la web del programa).\r\n–Cartas de aceptación de los tres profesores que propone como Tutor y Codirectores de tesis, cumplimentadas en el impreso DE04 (está en la web del programa).\r\n–CV de profesor Kirby Gookin.\r\n–Certificado  de notas de los estudios de Grado.', 1, 390, '1'),
	(2089, 11, '2016-10-08 21:51:00', '0000-00-00 00:00:00', '2016-10-09 00:54:00', '2016-10-21 22:47:00', '2016-10-31 23:50:56', 5, 2017, 'S02017C05U05110P02', 'arezoo.keyhani.1970@gmail.com', '1', 'Antonio Bautista Durán', 'completo', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 10.50, 'Debe completar la documentación requerida, empleando los impresos que se mencionan y que están en la web del programa de doctorado Arte y Patrimonio:\r\n–Falta Carta motivada (DE02).\r\n–Falta Memoria/Proyecto de tesis (DE03).\r\n–Faltan Cartas de aceptación de Tutor y Director de tesis propuestos (DE04).\r\n\r\nAdemás, debe aclarar si solicita la admisión en la modalidad de matrícula a tiempo parcial. En la solicitud indica matrícula a tiempo completo, pero ha entregado el impreso A07 (aunque está sin firmar).\r\nSi desea solicitar la modalidad de matrícula a tiempo parcial, debe entregar el impreso A07 firmado, y adjuntar documentación que justifique la solicitud. Y, en este caso, debería modificar la modalidad de matrícula recogida en su solicitud.', 1, 390, '1'),
	(2090, 11, '2016-10-08 22:09:00', '0000-00-00 00:00:00', '2016-10-09 00:55:00', '2016-10-10 12:59:00', '2016-11-01 00:14:04', 5, 2161, 'S02161C05U04565P02', 'lopezdesilva@gmail.com', '3', 'Francisco J. Lara-Barranco', 'completo', '', 15, 2, '', 60.42, 'Debe entragar Carta de aceptación firmada por el tutor/director de tesis propuesto, cumplimentada en el impreso DE04 (está en la web del programa de doctorado).', 1, 390, '1'),
	(2091, 11, '2016-10-08 22:21:00', '0000-00-00 00:00:00', '2016-10-09 00:56:00', '2016-10-17 11:03:00', '2016-10-31 23:52:39', 5, 2276, 'S02276C05U05386P02', 'lopehernande@hotmail.com', '1', 'José María Sánchez Sánchez', 'completo', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 22.98, '1. Falta el certificado de notas de los estudios de doctorado.\r\n2. En el impreso DE04 entregado, el profesor que propone como tutor y director de tesis solo se compromete a ser DIRECTOR. Sería recomendable que el profesor aceptase también ser su TUTOR, pues en caso contrario no se le podría aplicar la totalidad de los puntos que corresponden a este apartado en el baremo de ponderación que se emplea para seleccionar a los estudiantes admitidos: no ha entregado Carta de aceptación del tutor propuesto.', 1, 390, '1'),
	(2092, 11, '2016-10-08 22:41:00', '0000-00-00 00:00:00', '2016-10-09 00:57:00', '2016-10-21 21:05:00', '2016-10-31 23:53:54', 5, 1927, 'S01927C05U05003P02', 'correio@angelasaldanha.com', '1', 'María Isabel Moreno Montoro', 'parcial', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 19.00, '1. Debe entregar el impreso DE04 (está en la web del programa de doctorado Arte y Patrimonio) firmado por la profesora que propone como tutora y directora de tesis, haciando constar que acepta ser TUTORA y DIRECTORA de tesis (en el documento entregado no se menciona la función de tutora).\r\n2. El impreso en el que ha entregado la Memoria/Proyecto de tesis está sin firmar. Debe entregarlo firmado.\r\n3. En su solicitud indica que desea ser admitida en la modalidad de matrícula a tiempo parcial. Para ello, debe entregar cumplimentado y firmado el impreso A07, y justificar lo solicitado.\r\n', 1, 390, '1'),
	(2093, 11, '2016-10-08 22:59:00', '0000-00-00 00:00:00', '2016-10-09 00:58:00', '2016-10-24 11:02:00', '2016-10-31 23:55:44', 5, 2431, 'S02431C05U05043P02', 'fernandasantos.green@gmail.com', '1', 'Maria Isabel Moreno Montoro ', 'parcial', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 24.50, 'Como está publicado en la web del programa de Doctorado y en la de la Escuela Internacional de Doctorado, hay que entregar la siguiente DOCUMENTACIÓN GENERAL, que no ha entregado:\r\n\r\n1. "Acreditación de Estudios Universitarios oficiales previos (Grado, Licenciatura, Diplomatura, etc). Se requerirá el titule de los estudios previos (o resguardo de abono de los derechos de expedición) y certificado de notas."\r\n2. "Si ha solicitado modalidad a tiempo parcial: acreditación justificativa para ser considerado estudiante a tiempo parcial [...] se deberá aportar el impreso A07 [...] debidamente cumplimentado."\r\n\r\nEn cuanto alos DOCUMENTOS ESPECÍFICOS, debe entregar el impreso DE04 firmado por la profesora que propone como tutora y directora de tesis, haciendo constar que se compromete a desempañar ambas funciones.', 1, 390, '1'),
	(2094, 11, '2016-10-08 23:20:00', '0000-00-00 00:00:00', '2016-10-09 00:58:00', '2016-10-18 14:43:00', '2016-10-31 23:57:21', 5, 2049, 'S02049C05U05150P02', 'suzsousa@gmail.com', '1', 'Maria Pilar Garcia Abril', 'parcial', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 17.92, 'Habiendo indicado en su solicitud de admisión la modalidad de matrícula a tiempo parcial, deberá acreditar justificación para ser considerada estudiante a tiempo parcial, y deberá aportar el impreso A07 debidamente cumplimentado y firmado.', 1, 390, '1'),
	(2095, 11, '2016-10-08 23:37:00', '0000-00-00 00:00:00', '2016-10-09 01:00:00', '0000-00-00 00:00:00', '2016-10-31 23:58:29', 5, 2429, 'S02429C05U05067P02', 'desy_ree82@hotmail.com', '1', '', 'completo', 'Una vez aplicado el baremo de ponderación previsto en la Memoria de Verificación del programa de doctorad Arte y Patrimonio, no ha obtenido la puntuación mínima requerida para la admisión en este programa de doctorado.\r\n(*) Según Acuerdo de la Comisión Académica de 30 de marzo de 2016, para la admisión en el programa de doctorado Arte y Patriminio será necesario obtener una puntuación mínima de 30 puntos, al aplicar el baremo de ponderación previsto en la Memoria de Verificación del programa.', 14, 2, '', 15.30, 'Debe completar su solicitud, aportando los siguientes documentos:\r\n\r\n1. Cartas de acptación de los codirectores de tesis propuestos, cumplimentadas y firmadas en el impreso DE04 (está en la web del programa de doctorado).\r\n2. CV de los profesores que propone como codirectores de su tesis, puesto que no pertenecen al programa de docorado Arte y Patrimonio.\r\n3. Acreditación de que el profesor que propone como director 1º de su tesis cumple los requisitos previstos en el RD 1086/1989.\r\n4. Memoria/Proyecto de tesis cumplimentado en el impreso DE03 (está en la web del programa de doctorado).\r\n5. Certificado de notas de los estudios de doctorado cursados.', 0, 390, '1'),
	(2096, 11, '2016-10-08 23:49:00', '0000-00-00 00:00:00', '2016-10-09 01:01:00', '2016-10-21 02:34:00', '2016-11-01 00:22:56', 5, 2451, 'S02451C05U05519P02', 'tallerarte.experiencia@gmail.com', '3', 'Dr. Juan José Gómez de la Torre', 'completo', '', 15, 2, '', 53.32, 'Debe entregar cartas de aceptación firmadas por los tres codirectores de tesis que propone, cumplimentadas en el impreso DE04, que se encuentra en la web del programa de doctorado.\r\nAsimismo, deberá acreditar que la profesora que propone como 1ª directora de tesis posee experiencia investigadora acreditada en los términos establecidos en el RD 1086/1989.', 1, 390, '1'),
	(2097, 11, '2016-10-08 23:56:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2016-10-09 00:02:50', 5, 1750, 'S01750C05U04724P02', 'oresiodabaralla@yahoo.fr', '1', '', 'completo', 'La perfil académico de la solicitante  carece de la afinidad necesaria para su admisión en este programa de doctorado, pues como consta en la información publicada en relación con el programa de doctorado Arte y Patrimnio "El doctorando de nuevo ingreso debe poseer una serie de capacidades propias de un nivel de máster universitario, que en este caso consisten en poseer conocimientos, habilidades y capacidades específicas en el ámbito de la creación artística-plástica y la conservación y restauración de bienes culturales".', 14, 2, '', 7.21, '', 0, 390, '1'),
	(2098, 11, '2016-10-09 00:09:00', '0000-00-00 00:00:00', '2016-10-09 01:02:00', '2016-10-19 12:26:00', '2016-11-01 00:28:09', 5, 2194, 'S02194C05U05037P02', 'datriber@gmail.com', '3', 'Dr. JOSÉ MARÍA SÁNCHEZ SÁNCHEZ', 'parcial', '', 16, 2, '', 59.32, 'Debe completar su solicitud, aportando los siguientes documentos:\r\n1. Certificado de notas de la licenciatura.\r\n2. Habiendo indicado en su solicitud la modalidad de matrícula a tiempo parcial, debe acerditar la justificación para ser considerado estudiante a tiempo parcial, y entregar el impreso A07 debidamente cumplimentado y firmado.', 1, 390, '1'),
