	(2108, 11, '2016-10-10 12:42:00', '0000-00-00 00:00:00', '2016-10-10 12:45:00', '2016-10-13 14:43:00', '2016-10-27 19:32:35', 5, 2623, 'S02623C05U05598P09', 'carmela.es90@gmail.com', '1', '', 'completo', 'Todas las plazas ofertadas están cubiertas por candidatos cuya puntuación es superior a la del presente candidato.', 42, 9, '12', 2.70, 'Debe aportar la siguiente documentación: \r\nProyecto Preliminar de Tesis Doctoral, \r\nCarta de motivación, \r\nCurriculum Vitae, \r\ncertificado de notas donde se exprese la calificación media del título en base 4 - o documento oficial que explique las calificaciones y permita hallar la equivalencia -.', 1, 405, '1'),
	(2109, 11, '2016-10-10 12:51:00', '2016-10-26 12:59:00', '2016-10-10 12:54:00', '2016-10-17 16:30:00', '2016-11-09 13:40:55', 5, 1717, 'S01717C05U04681P04', 'rosa.lvidriero@gmail.com', '2', 'Prof. Andrés Carranza Bencano', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que falta la siguiente documentación, que puede subsanar hasta el día 25 de octubre:\r\n* Escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.', 1, 398, '1'),
