	(2112, 11, '2016-10-10 13:02:00', '2016-10-31 09:22:00', '2016-10-10 13:06:00', '2016-10-19 16:20:00', '2016-11-07 08:27:00', 5, 1640, 'S01640C05U04572P04', 'mcanton1@us.es', '3', ' Jesús Rodríguez Baños', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 25 de octubre, la siguiente documentación:\r\n* Intercambiar a tutor y director (ya que el tutor indicado no cumple el requisito de ser tutor, pero sí puede ser director).\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.', 1, 398, '1'),
