	(2116, 11, '2016-10-10 13:48:00', '0000-00-00 00:00:00', '2016-10-10 13:54:00', '2016-10-19 23:21:00', '2016-11-04 07:59:44', 5, 2158, 'S02158C05U04789P04', 'josejo3@hotmail.com', '3', 'Francisco Javier Padillo Ruiz', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 25 de octubre, la siguiente documentación:\r\n* Cambiar al tutor indicado, ya que no cumple el requisito para ser tutor, pero sí puede ser D. José López Barneo si Vd. lo confirma.\r\n* Aportar certificado con Nota Media Numérica del Máster Oficial de la Universidad Pablo de Olavide, teniendo en cuenta que el/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).  \r\n', 1, 398, '1'),
	(2117, 11, '2016-10-10 14:02:00', '2016-10-25 13:18:00', '2016-10-10 14:18:00', '2016-10-25 08:37:00', '2016-11-03 13:25:48', 5, 1848, 'S01848C05U04892P04', 'draparamo@gmail.com', '3', 'Guillermo Izquierdo Ayuso', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 25 de octubre, la siguiente documentación:\r\n* Cambiar al tutor, teniendo en cuenta que puede ser Guillermo Izquierdo Ayuso si modifica la línea de investigación a "Investigación Clínica".\r\n* Acreditar el tiempo parcial, por ejemplo aportando contrato como Facultativa Especialista.\r\nEn cuanto a su vía de acceso, comentarle que si desea que se considere el DEA de la Universidad Pablo de Olavide, debería acreditarlo (diploma y calificación). En caso contrario, puede entrar vía MIR, tal como solicita.\r\n\r\n', 1, 398, '1'),
