	(2119, 11, '2016-10-10 14:31:00', '2016-10-25 12:47:00', '2016-10-10 14:33:00', '2016-10-20 23:32:00', '2016-11-09 12:00:18', 5, 2235, 'S02235C05U05349P04', 'gyergap@gmail.com', '2', 'GUILLERMO ANTIÑOLO GIL', 'completo', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 25 de octubre, la siguiente documentación:\r\n* Cambiar de línea de investigación, ya que el tutor indicado pertenece a "Investigación Biomédica".\r\nAdemás, se entiende que el compromiso documental firmado vale como escrito justificando los medios materiales y financiación necesarios para el trabajo de investigación.', 1, 398, '1'),
