	(2124, 11, '2016-10-11 11:30:00', '2016-10-25 12:56:00', '2016-10-11 11:37:00', '2016-10-19 19:01:00', '2016-11-03 12:03:08', 5, 2364, 'S02364C05U05457P04', 'nuriy@hotmail.com', '3', 'MIRIAM ECHEVARRÍA IRUSTA', 'parcial', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente documentación:\r\n* La tutora indicada pertenece a otra línea de investigación, por lo que, debe confirmar la nueva línea: "Investigación Biomédica".\r\n* Acreditación justificativa para ser considerado estudiante a tiempo parcial, por ejemplo, contrato de trabajo.\r\n* Certificado con nota media numérica de la Licenciatura, teniendo en cuenta que el/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).', 1, 398, '1'),
