	(2126, 11, '2016-10-11 12:30:00', '2016-10-25 13:24:00', '2016-10-11 12:32:00', '2016-10-20 09:27:00', '2016-11-03 14:27:21', 5, 1756, 'S01756C05U04732P04', 'lola_navarro_amuedo@hotmail.com', '3', 'Jerónimo Pachón Díaz', 'parcial', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente documentación:\r\n* Intercambiar a tutor y director, ya que el tutor indicado no cumple el requisito por no ser profesor en activo de la Universidad de Sevilla, pero el director sí puede ser tutor.\r\n', 1, 398, '1'),
	(2127, 11, '2016-10-11 12:36:00', '2016-10-25 13:32:00', '2016-10-11 12:41:00', '2016-10-14 23:21:00', '2016-11-03 14:38:17', 5, 2343, 'S02343C05U04585P04', 'evacanper83@gmail.com', '3', 'JOSÉ ANTONIO ORDÓÑEZ FERNÁNDEZ', 'completo', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente información:\r\n* No propone tutor, pero puede ser el director Antonio Ordóñez Fernández, si lo confirma.\r\n* Aportar certificado académico con nota media del Máster Oficial, teniendo en cuenta que el/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).', 1, 398, '1'),
	(2128, 11, '2016-10-11 12:50:00', '2016-10-27 13:27:00', '2016-10-11 12:52:00', '2016-10-14 14:13:00', '2016-11-03 14:46:58', 5, 2340, 'S02340C05U05439P04', 'maryladisa@hotmail.com', '3', 'Ángel Vilches Arenas', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente documentación:\r\n* Intercambiar a tutor y director, ya que el tutor indicado no cumple el requisito por no pertenecer a ninguna línea del programa, pero D. Ángel Vilches Arenas sí puede ser tutor. \r\n', 1, 398, '1'),
	(2129, 11, '2016-10-11 12:55:00', '2016-10-27 13:50:00', '2016-10-11 13:02:00', '2016-10-18 18:38:00', '2016-11-03 14:49:10', 5, 1687, 'S01687C05U04629P04', 'josegomezferia@gmail.com', '3', 'Pablo Mir Rivera', 'parcial', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente información:\r\n* Su tutor pertenece a la línea "Investigación Biomédica", por lo que debe cambiar la línea de investigación.\r\n* Aportar justificante que acredite solicitar ser estudiante a tiempo parcial.\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación, ya que aparece SIN FIRMA. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo. \r\n', 1, 398, '1'),
	(2130, 11, '2016-10-11 13:41:00', '2016-10-31 08:49:00', '2016-10-11 13:45:00', '2016-10-21 23:25:00', '2016-11-03 14:53:06', 5, 2270, 'S02270C05U05377P04', 'kfabsan@gmail.com', '3', 'Fernando De La Portilla De Juan ', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente información:\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n* Justificante que acredite la necesidad de ser estudiante a tiempo parcial (por ejemplo, contrato de trabajo actual).', 1, 398, '1'),
	(2131, 11, '2016-10-11 13:58:00', '2016-10-31 08:51:00', '2016-10-11 13:59:00', '2016-10-19 12:20:00', '2016-11-03 14:49:49', 5, 2509, 'S02509C05U05190P04', 'pedderod@alum.us.es', '3', 'José Mª Romero Rodríguez', 'completo', '', 20, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente información:\r\n* El tutor indicado no cumple el requisito por no pertenecer a ninguna línea del programa, pero puede ser tutor José María Romero Rodríguez.\r\n', 1, 398, '1'),
	(2132, 11, '2016-10-11 14:17:00', '2016-11-02 08:56:00', '2016-10-11 14:22:00', '0000-00-00 00:00:00', '2016-11-04 08:08:36', 5, 1947, 'S01947C05U05027P04', 'joaquinlanz@gmail.com', '3', 'Jesús Rodríguez Baño', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente información:\r\n* NO PRESENTA TÍTULO DE MÁSTER OFICIAL DE LA UNIVERSIDAD PABLO DE OLAVIDE.\r\n* IGUALMENTE CERTIFICADO CON NOTA MEDIA DE DICHA TITULACIÓN, teniendo en cuenta que el/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).\r\n\r\n', 0, 398, '1'),
	(2133, 11, '2016-10-11 14:41:00', '2016-10-31 09:12:00', '2016-10-11 14:43:00', '2016-10-17 09:02:00', '2016-11-07 07:56:37', 5, 1592, 'S01592C05U04477P04', 'e.navarrovillaran@gmail.com', '3', 'Francisco Javier Padillo Ruiz', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 26 de octubre, la siguiente información:\r\n* Cambiar al tutor, ya que el indicado no cumple el requisito de ser profesor en activo de la Universidad de Sevilla. Para ser tutor es necesario además pertenecer al programa y, en su caso, a la línea de investigación "Investigación Biomédica".\r\n', 1, 398, '1'),
	(2134, 11, '2016-10-11 19:02:00', '0000-00-00 00:00:00', '2016-10-11 19:04:00', '2016-10-21 21:36:00', '2016-11-02 10:12:42', 5, 2347, 'S02347C05U05048P07', 'jmgarcia780@gmail.com', '1', 'JOSÉ ANTONIO DONOSO ANÉS', 'completo', 'NO ALCANZAR LA NOTA DE CORTE 5,48', 36, 7, '', 0.00, 'Documentación específica requerida por la Comisión Académica del Programa (esta información se encuentra dentro de la oferta del programa de doctorado en su apartado número 2 y en la plataforma de admisión. Requiere firma del director de la tesis y del tutor, profesor del programa de doctorado , en el caso de que el director no sea miembro del mismo).\r\nhttp://institucional.us.es/cees/wp-content/uploads/2015/07/INFORMACION_COMPLEMENTARIA_SOBRE_EL_PROCESO_DE_ADMISION_AL_PROGRAMA_DE_DOCTORADO_EN_ECONOMIA.docx\r\nAcreditación de Estudios Universitarios oficiales previos (Grado, Licenciatura, Diplomatura, etc.). Se requerirá el título de los estudios previos (o resguardo de abono de derechos de expedición) y certificado de notas.\r\n', 1, 399, '1'),
	(2135, 11, '2016-10-11 19:27:00', '0000-00-00 00:00:00', '2016-10-11 19:28:00', '2016-10-18 15:12:00', '2016-11-02 10:15:16', 5, 2381, 'S02381C05U05354P07', 'navp5@hotmail.com', '3', 'Jerónia Pons Pons', 'completo', '', 35, 7, '', 7.10, '□	Fotocopia del DNI, NIE (o, en su defecto, pasaporte para estudiantes extranjeros).\r\n□	Fotocopia del título con el que accede a los estudios de doctorado y certificado de notas.\r\n□	Los estudiantes extranjeros ajenos al EEES que no tengan el título homologado presentarán la autorización previa y el certificado de acreditación de estudios al Sr. Rector de la Universidad de Sevilla.\r\n□	Acreditación de Estudios Universitarios oficiales previos (Grado, Licenciatura, Diplomatura, etc.). Se requerirá el título de los estudios previos (o resguardo de abono de derechos de expedición) y certificado de notas.\r\n□	Acreditación justificativa para ser considerado estudiante a tiempo parcial.\r\n□	En el caso de estudiantes que soliciten el reconocimiento de necesidades académicas especiales se deberá aportar el impreso de  A07 - Solicitud de estudiante con necesidades académicas especiales debidamente cumplimentado y firmado.\r\n□	Documentación específica requerida por la Comisión Académica del Programa (esta información se encuentra dentro de la oferta del programa de doctorado en su apartado número 2 y en la plataforma de admisión. Requiere firma del director de la tesis y del tutor, profesor del programa de doctorado , en el caso de que el director no sea miembro del mismo).\r\nhttp://institucional.us.es/cees/wp-content/uploads/2015/07/INFORMACION_COMPLEMENTARIA_SOBRE_EL_PROCESO_DE_ADMISION_AL_PROGRAMA_DE_DOCTORADO_EN_ECONOMIA.docx\r\n\r\nSe recuerda que las publicaciones y los conocimientos de idiomas deben estar acreditados.\r\n\r\nEl plazo de subsanación será del 9 al 21 de octubre de 2016 a través de la plataforma web de admisión.\r\n', 1, 399, '1'),
	(2424, 11, '2016-10-28 10:01:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2016-10-28 10:01:31', 5, 2167, 'S02167C05U04822P01', 'fcooregar@gmail.com', '3', '', 'completo', '', 10, 1, '', 5250.00, '', 0, 388, '1'),
	(2136, 11, '2016-10-13 09:27:00', '2016-10-31 09:15:00', '2016-10-13 09:36:00', '2016-10-21 16:54:00', '2016-11-07 08:00:25', 5, 1575, 'S01575C05U04448P04', 'cgonzalezmatos@gmail.com', '3', 'Óscar Aramburu Bodas', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* El tutor indicado no cumple los requisitos, por tanto, debe cambiarlo por otro tutor que pertenezca a su línea de investigación del programa y además que sea profesor en activo de la Universidad de Sevilla.\r\n', 1, 398, '1'),
	(2137, 11, '2016-10-13 09:43:00', '2016-10-31 09:17:00', '2016-10-13 09:45:00', '2016-10-14 17:16:00', '2016-11-07 08:14:05', 5, 2604, 'S02604C05U05544P04', 'epineal@gmail.com', '3', 'DR. JUAN JOSÉ TOLEDO ARAL', 'completo', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* El tutor indicado pertenece a otra línea de investigación diferente a la suya. Por lo que, debería solicitar la línea: "Investigación Biomédica", en lugar de "Fisiología".\r\n', 1, 398, '1'),
	(2138, 11, '2016-10-13 09:52:00', '2016-10-31 09:27:00', '2016-10-13 09:57:00', '2016-10-21 12:49:00', '2016-11-07 11:34:39', 5, 2230, 'S02230C05U05347P04', 'noe_lasalasdelaluna@hotmail.com', '3', 'Juan Miguel Guerrero Montávez', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* Cambiar el tutor, ya que el indicado no cumple el requisito de pertenecer a su línea de investigación del programa.\r\n', 1, 398, '1'),
	(2139, 11, '2016-10-13 11:53:00', '2016-11-02 08:59:00', '2016-10-13 11:55:00', '2016-10-13 18:16:00', '2016-11-07 12:28:16', 5, 2205, 'S02205C05U05320P04', 'wurdalach@gmail.com', '3', 'Francisco Javier Padillo Ruiz', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* Acreditar la modalidad de permanencia "a tiempo parcial", por ejemplo, mediante contrato de trabajo.', 1, 398, '1'),
	(2140, 11, '2016-10-13 12:04:00', '2016-10-28 13:43:00', '2016-10-13 12:07:00', '2016-10-13 13:29:00', '2016-11-03 11:35:58', 5, 1607, 'S01607C05U04521P04', 'paulamcalvo@us.es', '3', 'Rosa Rodríguez de la Cruz', 'completo', '', 25, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* No propone tutor, pero puede elegir cualquiera de los dos directores indicados, ya que cumplen los requisitos.\r\n', 1, 398, '1'),
	(2141, 11, '2016-10-13 12:09:00', '2016-10-31 10:35:00', '2016-10-13 12:11:00', '2016-10-13 17:36:00', '2016-11-07 13:16:47', 5, 1753, 'S01753C05U04686P04', 'ejromerog@gmail.com', '3', 'Victor Sánchez Margalet', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* Acreditación justificativa para ser considerado estudiante "a tiempo parcial", por ejemplo, mediante contrato de trabajo.\r\n', 1, 398, '1'),
	(2142, 11, '2016-10-13 12:14:00', '2016-10-31 10:36:00', '2016-10-13 12:16:00', '2016-10-20 16:32:00', '2016-11-07 13:21:13', 5, 2603, 'S02603C05U04575P04', 'edu_david8@yahoo.es', '3', 'Mª Luz Montesinos Gutiérrez', 'completo', '', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* Cambiar al tutor, ya que el indicado no cumple el requisito de pertenecer a su línea de investigación del programa, teniendo en cuenta que además debe ser profesor en activo de la Universidad de Sevilla. \r\n', 1, 398, '1'),
	(2143, 11, '2016-10-13 12:18:00', '2016-10-31 10:38:00', '2016-10-13 12:19:00', '2016-10-15 20:32:00', '2016-11-07 14:42:26', 5, 2635, 'S02635C05U05376P04', 'veropinodiaz@gmail.com', '3', 'Fernando de la Portilla de Juan', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* No propone tutor, pero puede elegir entre algunos de los siguientes directores (Fernando de la Portilla de Juan o Francisco Javier Padillo Ruiz).', 1, 398, '1'),
	(2144, 11, '2016-10-13 12:52:00', '0000-00-00 00:00:00', '2016-10-13 13:52:00', '2016-10-26 16:10:00', '2016-11-14 14:46:53', 5, 2476, 'S02476C05U05539P04', 'labellaalvarezmarina@gmail.com', '1', '', 'completo', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque no ha subsanado en forma la información/documentación requerida.', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* Proponer un  tutor y director o directores . El tutor tiene que pertenecer a la línea de investigación solicitada, en su caso Investigación Biomédica, y ser profesor en activo de la Universidad de Sevilla.\r\n* Aportar un escrito firmado por el Director, y un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n\r\n* El/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre). En su caso el certificado "Licenciada en Medicina (UCO)" no incorpora nota media.\r\n', 1, 398, '1'),
	(2145, 11, '2016-10-13 14:02:00', '0000-00-00 00:00:00', '2016-10-14 08:44:00', '0000-00-00 00:00:00', '2016-10-25 12:59:44', 5, 1603, 'S01603C05U04510P10', 'alfonso@aguadoasesores.com', '1', 'Jesús Jordano Fraga', 'completo', 'Por no reunir la puntuación mínima requerida', 48, 10, '', 0.00, 'A efectos de poder valorar su solicitud de admisión al Programa de Doctorado de la Facultad de Derecho, y en aplicación del artículo 71 de la Ley 30/92 le comunico que en el plazo de 5 días hábiles deberá subsanar los siguientes requisitos:\r\nAcreditar publicaciones y experiencia profesional', 0, 406, '1'),
