	(2172, 11, '2016-10-14 13:14:00', '0000-00-00 00:00:00', '2016-10-14 13:17:00', '2016-10-25 13:56:00', '2016-11-14 12:38:41', 5, 1965, 'S01965C05U04788P04', 'sergiogarc@hotmail.com', '1', '', 'completo', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque su puntuación es inferior a la nota de corte requerida, siendo dicha nota de corte para este primer plazo de admisión del curso 16/17 de 6,240 puntos.', 23, 4, '22', 4.89, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 28 de octubre, adjuntando la siguiente información/documentación nueva:\r\n* Indicar tutor y director, teniendo en cuenta que el tutor debe pertenecer a su línea de investigación del programa y ser profesor en activo de la Universidad de Sevilla.\r\n* Falta título de Licenciado y DEA, escrito de tutor/director y carta motivada, así como el resto de documentación necesaria para evaluar por parte de la Comisión Académica, ya que únicamente presenta DNI y currículum vitae.', 1, 398, '1'),
	(2173, 11, '2016-10-14 12:50:00', '0000-00-00 00:00:00', '2016-10-14 13:24:00', '2016-10-24 18:35:00', '2016-11-14 12:01:01', 5, 2487, 'S02487C05U05552P04', 'natalia.moya.gonzalez@gmail.com', '1', 'Oscar Aramburu Bodas', 'parcial', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque su puntuación es inferior a la nota de corte requerida, siendo dicha nota de corte para este primer plazo de admisión del curso 16/17 de 6,240 puntos.', 24, 4, '16', 5.76, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 27 de octubre, la siguiente información:\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n*Aportar DNI\r\n*Aportar acreditación justificativa de modalidad a tiempo parcial.\r\n*Aportar acreditación de ser médico residente ya que solicita como vía de acceso:\r\n"Los titulados universitarios que, previa obtención de plaza en formación sanitaria especializada, hayan superado con evaluación positiva al menos dos años de formación en el programa de la especialidad de Ciencias de la Salud."\r\n\r\n\r\n\r\n', 1, 398, '1'),
	(2174, 11, '2016-10-14 13:23:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2016-10-14 13:24:07', 5, 2043, 'S02043C05U05147P11', 'tlestrada@uci.cu', '3', 'Juan Jesús Torres Gordillo ', 'completo', '', 60, 11, '', 0.00, '', 0, 407, '1'),
	(2175, 11, '2016-10-14 13:24:00', '0000-00-00 00:00:00', '2016-10-14 13:27:00', '0000-00-00 00:00:00', '2016-11-14 13:58:17', 5, 2312, 'S02312C05U05415P04', 'vjimenez@sevilla.es', '1', '', 'completo', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque no ha subsanado en plazo la información/documentación requerida\r\nSu plazo de subsanación finalizó el pasado 28 de octubre.\r\n', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 28 de octubre, adjuntando la siguiente información/documentación nueva:\r\n* Indicar nombre de tutor y director, teniendo en cuenta que el tutor debe pertenecer a su línea de investigación y ser profesor en activo de la Universidad de Sevilla.\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n* Presentar carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito.\r\n', 0, 398, '1'),
	(2176, 11, '2016-10-14 13:25:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2016-10-14 13:27:55', 5, 1707, 'S01707C05U04654P11', 'noralvis@uci.cu', '3', 'JULIO BARROSO OSUNA', 'completo', '', 60, 11, '', 0.00, '', 0, 407, '1'),
