	(2200, 11, '2016-10-18 11:52:00', '0000-00-00 00:00:00', '2016-10-18 11:57:00', '2016-11-01 16:43:00', '2016-11-09 14:12:21', 5, 2392, 'S02392C05U05199P04', 'alvaro.izquierdo.bajo@gmail.com', '2', 'Ángel Vilches Arenas', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación es hasta el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n* Indicar tutor y director, ya que no propone ninguno.\r\n* Acreditación justificativa para ser considerado estudiante "a tiempo parcial", por ejemplo, mediante contrato de trabajo.\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n\r\n* El/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).\r\nEn definitiva, debe aportar toda la documentación necesaria que le falta para ser baremado por parte de la Comisión Académica, ya que únicamente presenta currículum y carta de motivación.\r\n', 1, 398, '1'),
	(2201, 11, '2016-10-18 12:01:00', '2016-10-31 10:46:00', '2016-10-18 12:05:00', '2016-10-19 14:23:00', '2016-11-08 09:34:00', 5, 1949, 'S01949C05U04798P04', 'paula.s.m.1987@gmail.com', '3', 'Ignacio Obando Santaella', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación es hasta el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n\r\n* Cambiar al tutor, ya que el tutor indicado no cumple el requisito de ser profesor en activo de la Universidad de Sevilla.\r\n', 1, 398, '1'),
	(2202, 11, '2016-10-18 12:10:00', '2016-10-27 09:54:00', '2016-10-18 12:12:00', '2016-10-22 12:44:00', '2016-11-11 09:33:25', 5, 2083, 'S02083C05U05192P04', 'aglezmolina@gmail.com', '2', 'Francisco Javier Medrano Ortega', 'parcial', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación es hasta el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n* El tutor indicado pertenece a otra línea de investigación. Por lo que, puede indicar que desea cambiar a "Investigación Clínica".\r\n', 1, 398, '1'),
	(2203, 11, '2016-10-18 12:17:00', '0000-00-00 00:00:00', '2016-10-18 12:20:00', '2016-10-27 08:37:00', '2016-11-14 15:05:42', 5, 2410, 'S02410C05U05487P04', 'marciadulanto@yahoo.com', '1', 'Legibilidad del Consentimiento Informado del Servicio de Cirugía General del Hospital Universitario de Ceuta', 'parcial', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque, en principio, no ha subsanado en forma la información/documentación requerida y, posteriormente, el día 9 de noviembre subsana parcialmente fuera de plazo.', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación es hasta el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n* Proponer a un tutor, teniendo en cuenta que puede ser Francisco Javier Padillo Ruiz o Fernando de la Portilla de Juan.\r\n* Acreditación justificativa para ser considerado estudiante "a tiempo parcial", por ejemplo, mediante contrato de trabajo.\r\n* Aportar un escrito FIRMADO por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n\r\n* Aportar título de Licenciatura y certificado con nota media numérica, teniendo en cuenta que el/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).\r\n', 1, 398, '1'),
	(2204, 11, '2016-10-18 12:28:00', '2016-10-31 11:02:00', '2016-10-18 12:30:00', '2016-10-26 17:19:00', '2016-11-03 13:00:01', 5, 2432, 'S02432C05U04632P04', 'ferheca@gmail.com', '3', 'María Adoración Nieto García', 'completo', '', 24, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación es hasta el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n\r\n* Aportar certificado con nota media numérica de la Licenciatura en Medicina, teniendo en cuenta que el/los certificados de notas que se aporten para acreditar el requisito de acceso al programa deberán incorporar expresamente la nota media numérica (Baremo 1-4 por Real Decreto 1267/1994. De 10 de junio o Baremo 1-10 por Real Decreto 1125/2003, de 5 de septiembre).\r\n', 1, 398, '1'),
	(2205, 11, '2016-10-18 12:44:00', '0000-00-00 00:00:00', '2016-10-18 12:47:00', '2016-11-02 11:20:00', '2017-02-01 11:43:52', 5, 2203, 'S02203C05U05325P04', 'jufraes@hotmail.com', '2', 'Lucía Tabares Domínguez', 'completo', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque su puntuación es inferior a la nota de corte requerida, siendo dicha nota de corte para este primer plazo de admisión del curso 16/17 de 6,240 puntos.', 25, 4, '21', 6.20, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre, adjuntando toda la documentación necesaria para ser baremado por la Comisión Académica del Programa, dado que sólo aporta el DNI.', 1, 398, '1'),
