	(2207, 11, '2016-10-18 13:26:00', '0000-00-00 00:00:00', '2016-10-18 13:28:00', '2016-10-24 11:29:00', '2016-11-11 13:31:00', 5, 2207, 'S02207C05U05326P04', 'elenita_m_m@hotmail.com', '3', 'Dr. Jose Carlos Palomares Folía', 'completo', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque su puntuación es inferior a la nota de corte de este primer plazo de admisión del curso 16/17, siendo dicha nota de corte de 6,240 puntos.', 23, 4, '3', 6.18, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 2 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación es hasta el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n\r\n* Carta motivada en la que se exprese el interés del candidato por cursar el programa de doctorado y por la realización de la tesis doctoral en este ámbito. \r\n* Su tutor pertenece a otra línea de investigación, por lo que, puede solicitar cambiarse a "Investigación Biomédica".\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n', 1, 398, '1'),
