	(2231, 11, '2016-10-19 11:16:00', '0000-00-00 00:00:00', '2016-10-19 11:19:00', '0000-00-00 00:00:00', '2016-11-14 13:35:24', 5, 1934, 'S01934C05U05010P04', 'erodriguezvster@gmail.com', '1', 'MARÍA FRANCISCA GONZÁLEZ ESCRIBANO', 'completo', 'No ha sido admitido/a en el programa de doctorado BMBIC, porque no ha subsanado en forma la información/documentación requerida.', 23, 4, '', 0.00, 'Una vez revisada su solicitud, se comprueba que debe subsanar, hasta el día 3 de noviembre (plazo ampliado, ya que según el calendario oficial el plazo de subsanación finaliza el 21 de octubre), adjuntando la siguiente información/documentación nueva:\r\n\r\n* Indicar nombre de otro tutor, ya que el indicado no cumple el requisito de ser profesor en activo de la Universidad de Sevilla.\r\n\r\n* Aportar un escrito firmado por el Director, un tutor académico del Programa BMBIC caso que el Director no sea profesor del mismo y un responsable del laboratorio, Departamento o Centro donde vaya a realizarse el trabajo de investigación. En dicho escrito se describirá la existencia de los medios materiales y financiación necesarios para la realización del trabajo.\r\n\r\n', 0, 398, '1'),
