	(2280, 11, '2016-10-24 11:16:00', '0000-00-00 00:00:00', '2016-10-24 11:17:00', '2016-10-24 14:50:00', '2016-11-02 10:00:07', 5, 1883, 'S01883C05U04940P07', 'marife85.5@gmail.com', '3', 'Jeronia Pons Pons', 'completo', '', 35, 7, '', 6.54, '□	Fotocopia del DNI, NIE (o, en su defecto, pasaporte para estudiantes extranjeros).\r\n□	Fotocopia del título con el que accede a los estudios de doctorado y certificado de notas.\r\n□	Los estudiantes extranjeros ajenos al EEES que no tengan el título homologado presentarán la autorización previa y el certificado de acreditación de estudios al Sr. Rector de la Universidad de Sevilla.\r\n□	Acreditación de Estudios Universitarios oficiales previos (Grado, Licenciatura, Diplomatura, etc.). Se requerirá el título de los estudios previos (o resguardo de abono de derechos de expedición) y certificado de notas.\r\n□	Acreditación justificativa para ser considerado estudiante a tiempo parcial.\r\n□	En el caso de estudiantes que soliciten el reconocimiento de necesidades académicas especiales se deberá aportar el impreso de  A07 - Solicitud de estudiante con necesidades académicas especiales debidamente cumplimentado y firmado.\r\n□	Documentación específica requerida por la Comisión Académica del Programa (esta información se encuentra dentro de la oferta del programa de doctorado en su apartado número 2 y en la plataforma de admisión. Requiere firma del director de la tesis y del tutor, profesor del programa de doctorado , en el caso de que el director no sea miembro del mismo).\r\nhttp://institucional.us.es/cees/wp-content/uploads/2015/07/INFORMACION_COMPLEMENTARIA_SOBRE_EL_PROCESO_DE_ADMISION_AL_PROGRAMA_DE_DOCTORADO_EN_ECONOMIA.docx\r\n\r\nSe recuerda que las publicaciones y los conocimientos de idiomas deben estar acreditados.\r\n\r\n', 1, 399, '1'),
