INSERT INTO `t_vias_acceso` (`id`, `date_time`, `via`, `documentos`) VALUES
	(1, '2015-03-30 10:34:51', 'Estar en posesión de los títulos oficiales españoles de Grado, o equivalente, y de Máster Universitario o equivalente, siempre que se hayan superado, al menos, 300 ECTS en el conjunto de estas dos enseñanzas ', NULL),
	(2, '2015-03-30 10:35:18', 'Estar en posesión de un título universitario oficial español o del EEES que habilite para el acceso a Máster y haber superado un mínimo de 300 créditos ECTS, en el conjunto de estudios universitarios oficiales, de los que al menos 60 deben de ser de nivel de Máster.', NULL),
	(3, '2015-03-30 10:35:57', 'Estar en posesión de un título oficial español de Graduado/a, de al menos 300 ECTS y cursar complementos de formación, salvo que el plan de estudios cursado incluyera créditos de formación en investigación equivalentes a los de Máster. ', NULL),
	(4, '2015-03-30 10:37:37', 'Los titulados universitarios que, previa obtención de plaza en formación sanitaria especializada, hayan superado con evaluación positiva al menos dos años de formación en el programa de la especialidad de Ciencias de la Salud', NULL),
	(5, '2015-03-30 10:38:14', 'Estar en posesión de un título obtenido conforme a sistemas educativos extranjeros, sin necesidad de su homologación, previa comprobación por la universidad de que éste acredita un nivel de formación equivalente a la del título oficial español de Máster Universitario y que faculta en el país expedidor del título para el acceso a estudios de doctorado. Esta admisión no implicará la homologación del título previo ni su reconocimiento a otros efectos. ', NULL),
	(6, '2015-03-30 10:38:43', 'Estar en posesión de otro título español de Doctor obtenido conforme a anteriores ordenaciones universitarias', NULL),
	(7, '2015-03-30 10:39:00', 'Ser estudiante de doctorado conforme a anteriores ordenaciones universitarias previa admisión de la universidad correspondiente, de acuerdo con lo establecido en el RD 99/2011 y en la normativa de la propia universidad (periodo formativo de 60 ECTS en programa de doctorado RD 1393/2007)', NULL),
	(8, '2015-03-30 10:39:28', 'Licenciados, Arquitectos o Ingenieros que estuvieran en posesión del Diploma de Estudios Avanzados obtenido de acuerdo con lo dispuesto en el R.D. 778/1998 o hubieran alcanzado la suficiencia investigadora regulada en el R.D. 185/1985.', NULL),
	(9, '2016-07-29 10:56:27', 'Estar en posesión de un título universitario oficial que haya obtenido la correspondencia al nivel 3 del Marco Español de Cualificaciones para la Educación Superior, de acuerdo con el procedimiento establecido en el RD 967/2014, de 21 de noviembre', NULL);
